import Header from "./components/Header/Header";
import "./App.scss";
import video from "./Data/videos.json";

function App() {
  return (
    <>
      <Header />
      <video src={video[0].image} type="video/mp4" alt={video[0].title} />
    </>
  );
}

export default App;
